from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message

from stw_gen_sample3_api.types.core.periph3.state_type import State


@dataclass
class Critical(_Message):

    # Тактирование прибора
    systemClock: State
    # Системное время
    systemTimer: State
    # Непрерывное время
    steadyTimer: State
    # Интерфейс взаимодействия CAN1
    can1: State
    # Интерфейс взаимодействия CAN2
    can2: State


class CriticalDict(TypedDict):

    # Тактирование прибора
    systemClock: Union[State]

    # Системное время
    systemTimer: Union[State]

    # Непрерывное время
    steadyTimer: Union[State]

    # Интерфейс взаимодействия CAN1
    can1: Union[State]

    # Интерфейс взаимодействия CAN2
    can2: Union[State]

